# Fonction de test pour de nouvelles données
def predict_heart_disease(features, model=loaded_model, scaler=loaded_scaler):
    """
    Prédit le risque de crise cardiaque pour un patient donné

    Parameters:
    -----------
    features : list
        Liste des 13 caractéristiques du patient dans l'ordre suivant:
        [age, sex, cp, trestbps, chol, fbs, restecg, thalach, exang, oldpeak, slope, ca, thal]
    model : object, optional
        Modèle à utiliser pour la prédiction (par défaut, le modèle chargé)
    scaler : object, optional
        Scaler à utiliser pour standardiser les données (par défaut, le scaler chargé)

    Returns:
    --------
    dict
        Dictionnaire contenant la prédiction et la probabilité
    """
    # Vérifier la longueur des caractéristiques
    if len(features) != 13:
        return {"error": "Le nombre de caractéristiques doit être 13"}

    # Convertir en array numpy et standardiser
    features_array = np.array(features).reshape(1, -1)
    features_scaled = scaler.transform(features_array)

    # Faire la prédiction
    prediction = model.predict(features_scaled)[0]

    # Obtenir les probabilités si disponibles
    try:
        probabilities = model.predict_proba(features_scaled)[0]
        probability = probabilities[1] if prediction == 1 else probabilities[0]
    except:
        probability = None

    # Préparer le résultat
    result = {
        "prediction": int(prediction),
        "risk_level": "Risque élevé de crise cardiaque" if prediction == 1 else "Risque faible de crise cardiaque"
    }

    if probability is not None:
        result["probability"] = float(probability)

    return result

