def test_new_patient():
    """
    Fonction interactive pour tester de nouveaux patients
    """
    print("\n**Test interactif pour un nouveau patient**")
    print("Entrez les caractéristiques du patient (ou 'q' pour quitter):")

    feature_names = [
        'Âge',
        'Sexe (1=homme, 0=femme)',
        'Type de douleur thoracique (0-3)',
        'Pression artérielle au repos (mm Hg)',
        'Cholestérol sérique (mg/dl)',
        'Glycémie à jeun > 120 mg/dl (1=oui, 0=non)',
        'Résultats électrocardiographiques au repos (0-2)',
        'Fréquence cardiaque maximale atteinte',
        'Angine induite par l\'exercice (1=oui, 0=non)',
        'Dépression ST induite par l\'exercice',
        'Pente du segment ST de pointe (0-2)',
        'Nombre de grands vaisseaux (0-3)',
        'Thalassémie (1-3)'
    ]

    features = []
    for i, name in enumerate(feature_names):
        while True:
            try:
                value = input(f"{name}: ")
                if value.lower() == 'q':
                    return None
                features.append(float(value))
                break
            except ValueError:
                print("Valeur invalide. Veuillez entrer un nombre.")

    result = predict_heart_disease(features)
    return result
